#showstopper #bangaloretimesfashionweek From walking as a pool model to showstoppers in different fashion weeks and councils from India to International I have done a lot by God's Grace but this one #bgtfw @timesfashionweek @mytirang was extremely vulnerable and emotional affair for me. Cause here we have given interviews with the real heroes of garment industry and I.e. #artisans 

which is why instead of keeping that typical attitude eyes or dramatic expression it was a very normal me myself. Was greeting everyone in my middle class values imbibed by my ma pa of Namaste and charansparsh everyone feels. :):) proud of my culture tradition and values :):)

I feel privileged to be a part of @s_premanand jis vision and that he had vested his trust on me for doing this. He has given a mega platform by treasuring Indian handloom art and khadi to an international standard.

